import React from 'react';
import './App.css';

const numbers = [1, 4, 6, 8, 45, 89];

class App extends React.Component {
  constructor(props) {
    super(props);
    this.numbers = numbers;

  }


  render() {
    return (
      <div className="App">
        <ul className="list">
            {numbers
              .filter(number => number > 6)
              .map(number => {
              return (
                <li className="item">{number}</li>
              );
            })}
        </ul>
        <label htmlFor="input">Itroduce n√∫mero</label>
        <input 
          type="number" 
          id="input"
          name="input"
          value={numbers}
        />
      </div>
    );
  }
}

export default App;
